import React from "react";
import WithData from "../HOC/WithData";
import ItemList from "../ItemList";
import {WithSwapi} from "../HOC/WithSwapi/WithSwapi";

const withChildFN = (FN) => (Wrapper) => {
    return (props) => {
        return <Wrapper {...props}>
            {FN}
        </Wrapper>
    }
}
const mapPersonMethodsToProps = (sw) => ({
    getData: sw.getAllPeople
})
const mapPlanetMethodsToProps = (sw) => ({
    getData: sw.getAllPlanets
})
const mapStarShipMethodsToProps = (sw) => ({
    getData: sw.getAllStarship
})
const PersonList =   WithSwapi(mapPersonMethodsToProps)(
                                WithData(
                                    withChildFN(ItemList, ({name}) => <span>{name}</span>)));
const PlanetList =   WithSwapi(
                                mapPlanetMethodsToProps,
                                WithData(
                                    withChildFN(ItemList, ({name}) => <span>{name}</span>)));
const StarShipList = WithSwapi(
                                mapStarShipMethodsToProps,
                                WithData(
                                    withChildFN(ItemList, ({name, model}) => <span>{name} ({model})</span>)));

export {
    PersonList,
    PlanetList,
    StarShipList
}
